import styled from "@emotion/styled";
import { useEffect, useState } from "react";
import { Line } from "react-chartjs-2";
// import styled from "@emotion/styled/macro";

export default function LeftMenu() {
  // styles
  const [chartData, setChartData] = useState({});

  const chart = () => {
    setChartData({
      labels: [
        "23 сен",
        "24 сен",
        "25 сен",
        "26 сен",
        "27 сен",
        "28 сен",
        "29 сен",
      ],
      datasets: [
        {
          label: "level of thiccness",
          data: [0, 1000, 500, 1250, 1350, 700, 800],
          borderColor: "#2E71F3",
          borderWidth: 4,
        },
      ],
    });
  };
  const Container = styled.div`
    height: 200px;
    width: 525px;
  `;
  useEffect(() => {
    chart();
  }, []);
  return (
    <Container>
      <Line
        data={chartData}
        options={{
          responsive: true,
          maintainAspectRatio: false,
          legend: { display: false },
          scales: {
            xAxes: [
              {
                ticks: {
                  display: true,
                },
                gridLines: {
                  display: false,
                  drawBorder: false,
                },
              },
            ],
            yAxes: [
              {
                ticks: {
                  display: true,
                  callback: function (value, index, values) {
                    return (value % 10) + "тыс. ₽";
                  },
                },
                gridLines: {
                  display: true,
                  drawBorder: false,
                },
              },
            ],
          },
        }}
      ></Line>
    </Container>
  );
}
